import logo from './logo.svg'
import './App.css'
import { Route, Routes, useNavigate, Navigate } from 'react-router-dom';
import MyPage from './Components/MyPage/MyPage'
import Footer from './Components/Footer/Footer'

import NotFoundPage from './Components/NotFoundPage/NotFoundPage'
import Registration from './Components/Registration/Registration'
import MyFriendsPage from './Components/MyFriendsPage/MyFriendsPage'
import FriendsDreamsSlider from './Components/FriendsDreamsSlider/FriendsDreamsSlider'

function App() {
  return (
    <div className='App'>

      <Routes>

        <Route
        exact path="/register"
        element={
        <Registration/>
        }>
        </Route>

        <Route
        exact path="/page"
        element={
        <MyPage/>
        }>
        </Route> 

        <Route
        exact path="/myfriendpage"
        element={
        <MyFriendsPage/>
        }>
        </Route> 

        <Route
        exact path="/myfriendsfulldreams"
        element={
        <FriendsDreamsSlider/>
        }>
        </Route>

        <Route
        path="*"
        element={
        <NotFoundPage />
      }>
    </Route>
      </Routes>
    <Footer/>
    </div>
  );
}

export default App;
